import styled from "styled-components";
import { Container, Grid } from "semantic-ui-react";

export const StyledLandingContainer = styled(Container)`
  &&& {
    position: absolute;
    width: 1004px;
    height: 199px;
    left: 218px;
    top: 447px;
  }
`;

export const StyledTextContainer = styled(Container)`
  &&& {
    position: center;
    width: 745px;
    height: 220px;
    top: 852px;
  }
`;

export const StyledMissionTitle = styled.h1`
  &&& {
    color: #fcfcfc;
    font-family: Futura;
    font-size: 150px;
    font-style: normal;
    font-weight: 700;
    line-height: 199px;
    letter-spacing: 0em;
    text-align: left;
    text-shadow: 4px 4px 25px rgba(249, 214, 103, 0.5);
  }
`;

export const StyledStatement = styled.p`
  &&& {
    color: #fcfcfc;
    font-family: Avenir;
    font-size: 32px;
    font-style: normal;
    font-weight: 400;
    line-height: 44px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledTitle = styled.h2`
  &&& {
    color: white;
    font-family: Futura;
    font-size: 32px;
    font-style: normal;
    font-weight: 700;
    line-height: 43px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledDescription = styled.p`
  &&& {
    color: #afafaf;
    font-family: Avenir;
    font-size: 16px;
    font-style: normal;
    font-weight: 400;
    line-height: 22px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledText = styled.h4`
  &&& {
    /* Heading 1 */

    font-family: Futura;
    font-style: normal;
    font-weight: 500;
    font-size: 32px;
    line-height: 42px;
    /* identical to box height */

    color: #ffffff;
  }
`;
